import styled from 'styled-components'
import * as appStyles from '../appStyle'

export const Cart = styled.div`
    display : flex;
    background-color : ${appStyles.stickyCart};
    position: fixed;
    bottom: 10px;
    right: 0;
    left: 0;
    padding : 24px;
    margin : 0 40px;
`
